import React from "react";
import './App.css';
import './styles/test.scss'
import kasaLogo2 from "./asset/images/D_.png";


const App = () => {

  return (
    <div className="kasa-footer-banner">
      <div className="kasa-footer-titre">
      <img src={kasaLogo2} alt="logo Kasa noir et blanc"></img>
      </div>

    </div>
  );


};

export default App;
